    "2015-05-07T03:41:02.003738",nt"name": "defining-the-coupled-effects-of-cryogenic-space-radiation-and-hypervelocity-impact-damamge-168f6",nt"isopen":
    true,nt"url": null,nt"notes": "The intent of the proposed effort is to
    investigate the detailedncomposite overwrapped pressure vessel (COPV) performance
    characteristicsnafter being subject to irradiation, hypervelocity micro-meteor impact,nand
    cryogenic environments. This will result in a safer, more reliablendesign for high
    performance COPVs. This intent will be achieved vianempirical characterization of
    composite raw materials subsequent tonexposure of the aforementioned environments.
    Phase I of this effortn(NASA contract #NNM06AA56C) demonstrated a significant reduction
    innstructural performance following exposure to various combinations of thenaforementioned
    environments. This reduction in structural performancenwould seriously compromise
    the structural performance of any compositenstructure to be utilized in deep space
    applications. The data proposednin this effort would be extremely useful to NASA
    in what might be usednin the upcoming CEV and CONSTELLATION missions. The aerospace
    and thencommercial communities have shown significant interest in using filamentnwound
    COPVs for cryogenic applications. In addition there is seriousnconsideration for
    using COPVs in deep space exploration which wouldnsustain significant radiation
    exposure and possible impact damage.nConstituent raw materials and existing COPV
    designs have not beenncharacterized for the coupled effects of these applications
    and as suchnthe safety margins for these applications are undefined. Therefore,
    thenreliability of such usage is unknown.",nt"license_title": "U.S. Government
